import Data.Char

polymer :: String
polymer = ""
-- polymer = "dabAcCaCBAcCcaDA"

reduce :: String -> String
reduce []                                          = []
reduce (x:[])                                      = [x] 
reduce (x:y:xs) | x /= y && toLower x == toLower y = reduce xs
                | otherwise                        = x : reduce (y:xs)

shrink :: String -> String
shrink xs | xs == ys  = xs
          | otherwise = shrink ys
           where ys = reduce xs

puzzle9 :: Int
puzzle9 = length $ shrink polymer